import React, { useState, useEffect } from 'react';
import api from '../services/api';

function Indicators({ symbol, isIndianStock }) {
  const [indicators, setIndicators] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (symbol) {
      fetchIndicators();
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [symbol, isIndianStock]);

  const fetchIndicators = async () => {
    try {
      setLoading(true);
      setError(null);

      // Note: Currently backend only supports indicators for US stocks
      // You may need to add Indian stock indicators endpoint
      const data = await api.getIndicators(symbol, 30);
      setIndicators(data);
    } catch (err) {
      const errorMessage = err.response?.data?.detail || err.message || 'Unknown error';
      setError(`Failed to fetch indicators: ${errorMessage}`);
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const getCurrencySymbol = () => {
    return isIndianStock ? '₹' : '$';
  };

  if (loading) {
    return (
      <div className="section">
        <h3>📈 Technical Indicators</h3>
        <p>Loading indicators...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="section">
        <h3>📈 Technical Indicators</h3>
        <p className="error-text">{error}</p>
      </div>
    );
  }

  if (!indicators) {
    return (
      <div className="section">
        <h3>📈 Technical Indicators</h3>
        <p>No indicator data available</p>
      </div>
    );
  }

  const currencySymbol = getCurrencySymbol();

  return (
    <div className="section">
      <h3>📈 Technical Indicators - {symbol}</h3>
      <div className="indicators-list">
        {indicators.indicators && (
          <>
            <div className="indicator-item">
              <strong>RSI:</strong> {indicators.indicators.rsi?.toFixed(2) || 'N/A'}
            </div>
            <div className="indicator-item">
              <strong>MACD:</strong> {indicators.indicators.macd?.toFixed(2) || 'N/A'}
            </div>
            <div className="indicator-item">
              <strong>SMA (20):</strong> {currencySymbol}{indicators.indicators.sma_20?.toFixed(2) || 'N/A'}
            </div>
            <div className="indicator-item">
              <strong>EMA (20):</strong> {currencySymbol}{indicators.indicators.ema_20?.toFixed(2) || 'N/A'}
            </div>
            <div className="indicator-item">
              <strong>Bollinger Upper:</strong> {currencySymbol}{indicators.indicators.bb_upper?.toFixed(2) || 'N/A'}
            </div>
            <div className="indicator-item">
              <strong>Bollinger Lower:</strong> {currencySymbol}{indicators.indicators.bb_lower?.toFixed(2) || 'N/A'}
            </div>
          </>
        )}
      </div>
      <p className="data-info">
        <small>Currency: {isIndianStock ? 'INR (₹)' : 'USD ($)'}</small>
      </p>
    </div>
  );
}

export default Indicators;
